        <button 
            class="menu-toggle" 
            onclick={() => isMenuOpen = !isMenuOpen}
            aria-label="Toggle menu"
        >
            <span></span>
            <span></span>
            <span></span>
        </button>

        <nav class:active={isMenuOpen}>
            <ul>
                {#each navLinks as link}
                    <li>
                        <a href={link.href} onclick={handleNavClick}>
                            {link.label}
                        </a>
                    </li>
                {/each}
            </ul>
        </nav>
    </div>
</header>

<style>
    header {
        position: fixed;
        top: 0;
        left: 0;
        z-index: 10;
        width: 100%;
        display: flex;
        justify-content: center;
        background-color: #111111;
    }

    .container {
        position: relative;
        width: 95%;
        display: grid;
        grid-template-columns: repeat(12, 1fr);
        align-items: center;
    }

   .logo{
        position: relative;
        height: 50px;
        margin:  1rem 0;
        grid-column: span 6;
        /* width: 50px; */
    }

    svg{
        position: relative;
        /* width: 100%; */
        height: 100%;
    }

    .menu-toggle {
        display: none;
        flex-direction: column;
        gap: 5px;
        background: none;
        border: none;
        cursor: pointer;
        padding: 0;
        grid-column: 12;
        justify-self: end;
        z-index: 11;
    }

    .menu-toggle span {
        width: 24px;
        height: 2px;
        background: #fff;
        transition: all 0.3s ease;
    }

    nav {
        grid-column: 7 / span 6;
        display: flex;
        align-items: center;
        justify-content: flex-end;
    }

    ul {
        display: flex;
        list-style: none;
        margin: 0;
        padding: 0;
    }

    li {
        margin-left: 2rem;
    }

    li:first-child {
        margin-left: 0;
    }

    a {
        color: rgba(255, 255, 255, 0.8);
        text-decoration: none;
        font-size: 0.95rem;
        letter-spacing: 0.5px;
        transition: color 0.3s ease;
        text-transform: uppercase;
    }

    a:hover {
        color: #fff;
    }

    @media (max-width: 968px) {
        .menu-toggle {
            display: flex;
        }

        nav {
            position: fixed;
            top: 0;
            right: 0;
            bottom: 0;
            width: 70%;
            max-width: 300px;
            background: rgba(17, 17, 17, 0.98);
            backdrop-filter: blur(20px);
            transform: translateX(100%);
            transition: transform 0.3s ease;
            border-left: 1px solid rgba(255, 255, 255, 0.1);
            grid-column: auto;
        }

        nav.active {
            transform: translateX(0);
        }

        ul {
            flex-direction: column;
            gap: 0;
            padding: 2rem 2rem 2rem;
            width: 100%;
        }

        li {
            margin-left: 0;
            border-bottom: 1px solid rgba(255, 255, 255, 0.1);
        }

        li:first-child {
            margin-left: 0;
        }

        nav a {
            display: block;
            padding: 1.25rem 0;
            font-size: 1rem;
        }
    }
</style>